original_question:
Obdĺžnikové pole je uzavreté v atletickej dráhe, ako je znázornené nižšie. Dráha pozostáva z dvoch hrán poľa a dvoch polkruhov. Dĺžka dráhy je 400 metrov. Aká je najväčšia možná plocha poľa v štvorcových metroch?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

